import React from 'react';
import { HeroBg } from './HeroElemnet';

const HeroSection = () => {
    return (
        <HeroContainer id="Home">
            <HeroBg>
            <VideoBg autoPlay loop muted src={Video} type='video/mp4' />
            </HeroBg>
        </HeroContainer>
    );
};

export default HeroSection;
